import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 24, height: 24, viewBox: "0 0 24 24", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M18 8H6a2 2 0 00-2 2v4a2 2 0 002 2h12a2 2 0 002-2v-4a2 2 0 00-2-2zM5.5 10a.5.5 0 01.5-.5h12a.5.5 0 01.5.5v2h-13v-2z", fill: primaryFill }));
};
const PortUsbA24Regular = wrapIcon(rawSvg({}), 'PortUsbA24Regular');
export default PortUsbA24Regular;
